import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './index.scss';
import AnimatedLetters from '../AnimatedLetters';

const Historic = () => {
  const [error, setError] = useState(null);
  const [examData, setExamData] = useState([]);
  const [selectedExams, setSelectedExams] = useState([]);
  const [letterClass, setLetterClass] = useState("text-animate");
  const [searchQuery, setSearchQuery] = useState("");
  const [selectedYears, setSelectedYears] = useState([]);
  const isMobileView = window.innerWidth <= 1150;

  // API base URL - use environment variable or fallback to localhost
  const API_BASE_URL = process.env.REACT_APP_API_URL || 'http://localhost:8080';

  const yearOptions = [
    { label: "F2024", value: "f2024" },
    { label: "S2024", value: "s2024" },
    { label: "F2023", value: "f2023" },
    { label: "S2023", value: "s2023" }
  ];

  useEffect(() => {
    const params = new URLSearchParams(window.location.search);
    const className = params.get('names');
    const years = params.get('years');

    if (className) {
      setSearchQuery(className);
    }

    if (years) {
      setSelectedYears(years.split(','));
    }

    const timer = setTimeout(() => {
      setLetterClass("text-animate-hover");
    }, 1);

    if (className && years) {
      axios
        .get(`${API_BASE_URL}/api/v1/historic-exams/historic?names=${encodeURIComponent(className)}&years=${encodeURIComponent(years)}`)
        .then((response) => {
          setExamData(response.data);
        })
        .catch((error) => {
          setError(error);
        });
    } else {
      setExamData([]);
    }

    return () => {
      clearTimeout(timer);
    };
  }, [API_BASE_URL]);

  const handleSearchChange = (event) => {
    setSearchQuery(event.target.value);
  };

  const handleYearChange = (event) => {
    const value = event.target.value;
    setSelectedYears((prevSelectedYears) =>
      prevSelectedYears.includes(value)
        ? prevSelectedYears.filter((year) => year !== value)
        : [...prevSelectedYears, value]
    );
  };

  const handleGoButtonClick = () => {
    const selectedYearsString = selectedYears.join(',');

    setTimeout(() => {
      window.location.href = `/historical?names=${encodeURIComponent(searchQuery)}&years=${encodeURIComponent(selectedYearsString)}`;
    }, 1);
  };

  const handleKeyPress = (event) => {
    if (event.key === "Enter") {
      handleGoButtonClick();
    }
  };



  if (error) {
    return <p>Error: {error.message}</p>;
  }

  return (
    <>
    <div className="container data-page">
      <div className="text-zone">
        <h1>
          <br />
          <br />
          <AnimatedLetters letterClass={letterClass} strArray={"Historical Exams".split("")} idx={10} />
        </h1>
        {examData.length === 0 ? (
          <h2>Please search for one or more courses and select at least one year!</h2>
        ): (
          <div className="table-container">
          <table>
            <thead>
              <tr>
                {isMobileView ? (
                  <>
                    <th>Course</th>
                    <th>Year</th>
                    <th>Exam Start Time</th>
                    <th>Exam End Time</th>
                  </>
                ): (
                  <>
                    <th>Course</th>
                    <th>Year</th>
                    <th>Exam Start Time</th>
                    <th>Exam End Time</th>
                    <th>Exam Type</th>
                    <th>Building</th>
                    <th>Room</th>
                    <th>Rows</th>
                    <th>Row Start</th>
                    <th>Row End</th>
                  </>
                )}
              </tr>
            </thead>
            <tbody>
              {examData.map((exam) => (
                <tr key={`${exam.course}-${exam.section}`}>
                  <td>{exam.course}</td>
                  <td>{exam.year}</td>
                  <td>{exam.exam_start_time}</td>
                  <td>{exam.exam_end_time}</td>
                  {!isMobileView && (
                    <>
                      <td>{exam.exam_type}</td>
                      <td>{exam.building}</td>
                      <td>{exam.room}</td>
                      <td>{exam.rows_from}</td>
                      <td>{exam.row_start}</td>
                      <td>{exam.row_end}</td>
                    </>
                  )}
                </tr>
              ))}
            </tbody>
          </table>
        </div>
        )}
        <h2>
          <div className="searchContainer">
            <div className="searchBox">
              <input
                className="searchInput"
                type="text"
                placeholder="Search for more exams"
                value={searchQuery}
                onChange={handleSearchChange}
                onKeyPress={handleKeyPress}
              />
             <button class="searchButton" href="#" onClick={handleGoButtonClick}>
              <svg xmlns="http://www.w3.org/2000/svg" width="29" height="29" viewBox="0 0 29 29" fill="none">
